Actionscript.script:
var 狼炮耗蓝 = Math.ceil(_parent.mp满血值 * 0.1);

if(_parent.mp >= 狼炮耗蓝 && _parent.mp满血值 >= 800)
{
	_parent.mp -= 狼炮耗蓝;
}
else
{_parent.动画完毕();}

_parent.UpdateBigSmallState("普攻中","空手一段中");

function 攻击时移动(慢速度, 快速度)
{
	if (_parent.方向 == "右")
	{
		if (Key.isDown(_root.右键) == true)
		{
			_parent.移动("右",快速度);
		}
		else
		{
			_parent.移动("右",慢速度);
		}
	}
	else if (_parent.方向 == "左")
	{
		if (Key.isDown(_root.左键) == true)
		{
			_parent.移动("左",快速度);
		}
		else
		{
			_parent.移动("左",慢速度);
		}
	}
}
function 攻击时按键四向移动(慢速度, 快速度)
{
	var 上下未按键 = 0;
	var 左右未按键 = 0;
	if (Key.isDown(_parent.上键) == true)
	{
		_parent.移动("上",快速度 / 2);
	}
	else if (Key.isDown(_parent.下键) == true)
	{
		_parent.移动("下",快速度 / 2);
	}
	else
	{
		上下未按键 = 1;
	}
	if (Key.isDown(_parent.左键) == true)
	{
		_parent.移动("左",快速度);
	}
	else if (Key.isDown(_parent.右键) == true)
	{
		_parent.移动("右",快速度);
	}
	else
	{
		左右未按键 = 1;
	}
	if (上下未按键 && 左右未按键)
	{
		攻击时移动(慢速度,快速度);
	}
}
function 攻击时可改变移动方向(速度)
{
	if (Key.isDown(_parent.右键) == true)
	{
		_parent.方向改变("右");
	}
	else if (Key.isDown(_parent.左键) == true)
	{
		_parent.方向改变("左");
	}
	if (_parent.方向 == "右")
	{
		_parent.移动("右",速度);
	}
	else if (_parent.方向 == "左")
	{
		_parent.移动("左",速度);
	}
}
function 攻击时斜向移动(慢速度, 快速度)
{
	if (_parent.方向 == "右")
	{
		if (Key.isDown(_parent.右键) == true)
		{
			_parent.移动("右",快速度);
		}
		else
		{
			_parent.移动("右",慢速度);
		}
	}
	else if (_parent.方向 == "左")
	{
		if (Key.isDown(_parent.左键) == true)
		{
			_parent.移动("左",快速度);
		}
		else
		{
			_parent.移动("左",慢速度);
		}
	}
	if (Key.isDown(_parent.上键) == true)
	{
		_parent.移动("上",快速度);
	}
	else if (Key.isDown(_parent.下键) == true)
	{
		_parent.移动("下",快速度);
	}
}
function 攻击时可斜向改变移动方向(速度)
{
	if (Key.isDown(_parent.右键) == true)
	{
		_parent.方向改变("右");
	}
	else if (Key.isDown(_parent.左键) == true)
	{
		_parent.方向改变("左");
	}
	if (_parent.方向 == "右")
	{
		_parent.移动("右",速度);
	}
	else if (_parent.方向 == "左")
	{
		_parent.移动("左",速度);
	}
	if (Key.isDown(_parent.上键) == true)
	{
		_parent.移动("上",速度 / 2);
	}
	else if (Key.isDown(_parent.下键) == true)
	{
		_parent.移动("下",速度 / 2);
	}
}
function 攻击时可斜向改变移动方向2(速度, 上下)
{
	if (Key.isDown(_parent.右键) == true)
	{
		_parent.方向改变("右");
	}
	else if (Key.isDown(_parent.左键) == true)
	{
		_parent.方向改变("左");
	}
	if (_parent.方向 == "右")
	{
		_parent.移动("右",速度 / 2);
	}
	else if (_parent.方向 == "左")
	{
		_parent.移动("左",速度 / 2);
	}
	if (上下 > 0)
	{
		_parent.移动("上",速度);
	}
	else if (上下 < 0)
	{
		_parent.移动("下",速度);
	}
}

function 变招判定(招式名, 招式是否结束, 是否屏蔽跳跃)
{
	if (_parent.操控编号 != -1 and _root.控制目标全自动 == false)
	{
		if (!_parent.飞行浮空 && _parent.动作B && !是否屏蔽跳跃)
		{
			_parent.状态改变("空手跳");
		}
		else if (!_parent.飞行浮空 && Key.isDown(_root.键1))
		{
			_parent.状态改变("攻击模式切换");
		}
		else if (_parent.动作A && 招式名)
		{
			if (_parent.左行)
			{
				_parent.右行 = 0;
				_parent.方向改变("左");
			}
			else if (_parent.右行)
			{
				_parent.左行 = 0;
				_parent.方向改变("右");
			}
			gotoAndPlay(招式名);
		}
		else if (_parent.左行 || _parent.右行 || _parent.上行 || _parent.下行)
		{
			_parent.动画完毕();
		}
	}
	else if (招式名 && !招式是否结束)
	{
		gotoAndPlay(招式名);
	}
}
空手攻击搓招 = _root.技能函数.空手攻击搓招;
诛杀步可派生搓招 = _root.技能函数.诛杀步可派生搓招;
后撤步可派生搓招 = _root.技能函数.后撤步可派生搓招;
波动拳可派生搓招 = _root.技能函数.波动拳可派生搓招;
能量喷泉可派生搓招 = _root.技能函数.能量喷泉可派生搓招;
燃烧指节可派生搓招 = _root.技能函数.燃烧指节可派生搓招;

if(_parent.空手动作类型){
	帧名 = _parent.空手动作类型 + "1连招";
	gotoAndPlay(帧名);
}

